import React, { Component } from "react";

class ListMenu extends Component {
  render() {
    return (
      <div class="card" style={{ width: "18rem" }}>
        <div class="card-body">
          <p class="card-text">Choose C robot type</p>
        </div>
        <ul class="list-group list-group-flush">
          <li class="list-group-item">All robots</li>
          <li class="list-group-item">Warehouse</li>
          <li class="list-group-item">Surveillance</li>
          <li class="list-group-item">Light managers</li>
          <li class="list-group-item">Maintenance</li>
          <li class="list-group-item">Packing</li>
        </ul>
      </div>
    );
  }
}

export default ListMenu;
